import { Link } from '@phosphor-icons/react';
import React from 'react';

export default function Nav() {
    return (
        <div>
            <Link to="/">Home</Link>
            <Link >Shop</Link>
            <Link >Featured</Link>
            <Link >Recommended</Link>
        </div>
    )
}
